import Header from "./components/Header";
import Footer from "./components/Footer";
import NotesList from "./pages/NotesList"
import React from "react";
import { Routes ,Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="wrapper">
        <Header />
        <Switch>
          <Route path="/about">
            <About />
          </Route>

          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}
function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}
export default App;
